      function fromBase64(binstr) {
        const safeStr = atob(binstr);
        const arr = new Uint8Array(safeStr.length);
        for (let i = 0; i < safeStr.length; i += 1) {
          arr[i] = safeStr.charCodeAt(i);
        }
        return new TextDecoder().decode(arr);
